(1, 'Aliens', 1986, 150, 'James Cameron', 'James Cameron', 'James Horner', 1, , 3, 'Alien es un organismo perfecto, una máquina de matar cuya superioridad física sólo puede competir con su agresividad. La oficial Ripley y la tripulación de la nave “Nostromo” se habían enfrentado, en el pasado, a esa monstruosa criatura. Y sólo Ripley sobrevivió a la masacre. Después de vagar por el espacio durante varios años, Ripley fue rescatada. Durante ese tiempo, el planeta de Alien ha sido colonizado. ', 8.6, b'0', b'0', b'1', b'1', b'1', b'0', b'0', 'https://www.youtube-nocookie.com/embed/OE5mUBN_NXs');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(2, 'Spiderman 2', 2004, 127, 'Sam Raimi', 'Alvin Sargent', 'Danny Elfman', 5, , 1, 'Han pasado dos años desde que el tranquilo Peter Parker dejó a Mary Jane Watson, su gran amor, y decidió seguir asumiendo sus responsabilidades como Spider-Man. Peter debe afrontar nuevos desafíos mientras lucha contra el don y la maldición de sus poderes equilibrando sus dos identidades: el escurridizo superhéroe Spider-Man y el estudiante universitario. Las relaciones con las personas que más aprecia están ahora en peligro de ser descubiertas con la aparición del poderoso villano de múltiples tentáculos Doctor Octopus.', 8.2, b'0', b'0', b'1', b'1', b'1', b'0', b'0', 'https://www.youtube-nocookie.com/embed/0EhKGAfNBBw');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(3, 'Mortal Kombat', 1995, 102, 'Paul W.S. Anderson', 'Kevin Droney', 'George S. Clinton', 2, , 8, 'Durante nueve generaciones, Shang Tsung, un brujo malvado, ha llevado a un poderoso príncipe a la victoria contra sus mortales enemigos. Si vence el décimo torneo Mortal Kombat, la desolación y el mal que han florecido en el mundo exterior reinarán la Tierra por siempre.', 6.2, b'0', b'1', b'0', b'1', b'0', b'1', b'1', 'https://www.youtube-nocookie.com/embed/UkZ1IF_RIl0');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(4, 'Titanic', 1997, 195, 'James Cameron', 'James Cameron', 'James Horner', 3, , 3, 'Jack (DiCaprio), un joven artista, gana en una partida de cartas un pasaje para viajar a América en el Titanic, el transatlántico más grande y seguro jamás construido. A bordo conoce a Rose (Kate Winslet), una joven de una buena familia venida a menos que va a contraer un matrimonio de conveniencia con Cal (Billy Zane).', 6.2, b'0', b'1', b'1', b'0', b'0', b'0', b'1', 'https://www.youtube-nocookie.com/embed/G-M3zXm2fU0');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(5, 'Lego Pelicula', 2014, 100, 'Phil Lord', 'Phil Lord', 'Mark Mothersbaugh', 9, , 8, 'Cuenta la historia de Emmet, una figurita LEGO absolutamente normal y fiel a las normas que es identificada por error como la persona más extraordinaria y la clave para salvar al mundo. Se ve entonces inmerso en una búsqueda épica para detener a un malvado tirano junto a un grupo de desconocidos, una aventura para la que Emmet no está preparado en absoluto.', 8.2, b'1', b'1', b'0', b'0', b'0', b'1', b'1', 'https://www.youtube-nocookie.com/embed/1qhm19E452s');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(6, 'Rocky', 1976, 119, 'John G. Avildsen', 'Sylvester Stallone', 'Bill Conti', 3, , 5, 'Rocky Balboa es un desconocido boxeador a quien se le ofrece la posibilidad de pelear por el título mundial de los pesos pesados. Con una gran fuerza de voluntad, Rocky se prepara concienzudamente para el combate y también para los cambios que acabarán produciéndose en su vida.', 8.9, b'1', b'1', b'0', b'0', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/7RYpJAUMo2M');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(7, 'E.T.', 1982, 115, 'Steven Spielberg', 'Melissa Mathison', 'John Williams', 3, , 6, 'Un pequeño ser de otro planeta se queda abandonado en la Tierra cuando su nave, al emprender el regreso, se olvida de él. Está completamente solo y tiene miedo, pero se hará amigo de un niño, que lo esconde en su casa. El pequeño y sus hermanos intentan encontrar la forma de que el pequeño extraterrestre regrese a su planeta antes de que lo encuentren los científicos y la policía.', 9.1, b'0', b'1', b'1', b'0', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/p4vSher2e3A');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(8, 'El último gran héroe', 1993, 130, 'John McTiernan', 'Shane Black', 'Michael Kamen', 4, , 1, 'Danny Madigan es un chico fantasioso, ferviente admirador de Jack Slater, el mayor héroe del cine de acción. Cuando se estrena su última película, el viejo acomodador del cine le regala una entrada para que la vea en primicia. Gracias a esa entrada, que resulta tener poderes mágicos, Danny consigue introducirse en la pantalla y vivir trepidantes aventuras con Jack.', 6.8, b'0', b'1', b'1', b'0', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/Kt95f2ozVYc');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(9, 'Vengadores Endgame', 2019, 181, 'Anthony Russo', 'Christopher Markus', 'Alan Silvestri', 5, , 4, 'Después de los eventos devastadores de Avengers: Infinity War, el universo está en ruinas debido a las acciones de Thanos, el Titán Loco. Con la ayuda de los aliados que quedaron, los Vengadores deberán reunirse una vez más para intentar deshacer sus acciones y restaurar el orden en el universo de una vez por todas, sin importar cuáles son las consecuencias... ', 8.5, b'0', b'0', b'1', b'1', b'1', b'0', b'0', 'https://www.youtube-nocookie.com/embed/svLSGZkTzC0');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(10, 'Deja Vu', 2006, 128, 'Tony Scott', 'Terry Rossio', 'Harry Gregson-Williams', 6, , 14, 'El agente Doug Carlin (Denzel Washington) descubre que la explosión de una bomba en un Ferry de Nueva Orleáns es obra de un terrorista. Por su perspicacia para analizar y distinguir rápidamente lo relevante de lo secundario en el escenario del crimen, Carlin es integrado en un misterioso equipo de investigación que utiliza una sofisticada máquina que permite hacer algo extraordinario...', 7.8, b'0', b'0', b'1', b'1', b'1', b'0', b'0', 'https://www.youtube-nocookie.com/embed/CDjeBFrVhDI');
