(11, 'El gran Showman', 2017, 105, 'Michael Gracey', 'Jenny Bicks', 'Benj Pasek', 8, , 3, 'Biopic sobre Phineas Taylor Barnum (1810-1891), un empresario circense estadounidense que fundó el \"Ringling Bros. and Barnum & Bailey Circus\", conocido como \"el mayor espectáculo en la tierra\". ', 8.7, b'0', b'1', b'1', b'1', b'1', b'0', b'0', 'https://www.youtube-nocookie.com/embed/uprrVIIT0G8');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(12, 'El gurú de las bodas', 2015, 98, 'Jeremy Garelick', 'Jeremy Garelick', 'Christopher Lennertz', 10, , 9, 'A menos de dos semanas de casarse con Gretchen (Kaley Cuoco), la chica de sus sueños, Doug Harris (Josh Gad) no encuentra siquiera a un conocido que pueda hacer de padrino en su boda, por lo que termina contratando a Jimmy Callahan (Kevin Hart), propietario de una empresa que provee de falsos padrinos a novios solitarios como él. ', 6.8, b'1', b'0', b'1', b'0', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/PXOmnNpDNIk');
