(13, 'Expediente Warren', 2013, 112, 'James Wan', 'Chad Hayes', 'Joseph Bishara', 7, , 8, 'Basada en una historia real documentada por los reputados demonólogos Ed y Lorraine Warren. Narra los encuentros sobrenaturales que vivió la familia Perron en su casa de Rhode Island a principios de los 70. El matrimonio Warren, investigadores de renombre en el mundo de los fenómenos paranormales, acudieron a la llamada de esta familia aterrorizada por la presencia en su granja de un ser maligno.', 9.1, b'0', b'1', b'1', b'0', b'0', b'1', b'0', 'https://www.youtube-nocookie.com/embed/1kOlrEwTfco');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(14, 'Free Guy', 2021, 115, 'Shawn Levy', 'Matt Lieberman', 'Christophe Beck', 1, , 3, 'Guy (Ryan Reynolds) trabaja como cajero de un banco, y es un tipo alegre y solitario al que nada la amarga el día. Incluso si le utilizan como rehén durante un atraco a su banco, él sigue sonriendo como si nada. Pero un día se da cuenta de que Free City no es exactamente la ciudad que él creía. Guy va a descubrir que en realidad es un personaje no jugable dentro de un brutal videojuego.', 6.3, b'0', b'1', b'1', b'1', b'1', b'0', b'0', 'https://www.youtube-nocookie.com/embed/VMlmcUelw-c');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(15, 'Lego Pelicula 2', 2019, 93, 'Mike Mitchell', 'Phil Lord', 'Mark Mothersbaugh', 9, , 8, 'Después de cinco años de tranquilidad aparece una nueva amenaza: invasores de LEGO DUPLO del espacio exterior que lo destrozan todo antes de que dé tiempo a reconstruirlo. Emmet, Lucy, Batman y sus amigos unirán fuerzas para librar una batalla que les llevará a mundos inexplorados.', 6.7, b'0', b'1', b'0', b'1', b'0', b'1', b'0', 'https://www.youtube-nocookie.com/embed/WPiQJyTwOPY');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(16, 'Superman', 1978, 143, 'Richard Donner', 'Robert Benton', 'John Williams', 5, , 8, 'Desde una galaxia remota, un recién nacido es enviado por sus padres al espacio debido a la inminente destrucción del planeta donde viven. La nave aterriza en la Tierra, y el niño es adoptado por unos granjeros que le inculcan los mejores valores humanos. Con los años, el joven se irá a Metrópolis y allí usará sus poderes sobrenaturales para luchar contra el mal.', 7.2, b'0', b'1', b'1', b'1', b'0', b'1', b'0', 'https://www.youtube-nocookie.com/embed/Ha9cy92X5ws');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(17, 'John Wick 2', 2017, 122, 'Chad Stahelski', ' Derek Kolstad', 'Tyler Bates', 2, , 16, 'El legendario asesino John Wick (Keanu Reeves) se ve obligado a salir del retiro por un exasociado que planea obtener el control de un misterioso grupo internacional de asesinos. Obligado a ayudarlo por un juramento de sangre, John emprende un viaje a Roma lleno de adrenalina estremecedora para pelear contra los asesinos más peligrosos del mundo.', 8.7, b'1', b'1', b'1', b'0', b'0', b'1', b'0', 'https://www.youtube-nocookie.com/embed/jbeRIvRRxdE');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(18, 'Jurassic Park', 1993, 121, 'Steven Spielberg', 'Michael Crichton', 'John Williams', 1, , 6, 'El multimillonario John Hammond consigue hacer realidad su sueño de clonar dinosaurios del Jurásico y crear con ellos un parque temático en una isla remota. Antes de abrirlo al público, invita a una pareja de eminentes científicos y a un matemático para que comprueben la viabilidad del proyecto. Pero las medidas de seguridad del parque no prevén el instinto de supervivencia de la madre naturaleza ni la codicia humana.', 8.8, b'1', b'1', b'0', b'0', b'0', b'0', b'1', 'https://www.youtube-nocookie.com/embed/RtBuQmT6bb4');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(19, 'Jumanji', 1995, 104, 'Joe Johnston', 'Jonathan Hensleigh', 'James Horner', 4, , 5, 'Alan Parris queda atrapado durante 25 años en un juego de mesa mágico y muy antiguo llamado Jumanji. Cuando, por fin, es liberado por dos niños, una manada de animales exóticos queda también en libertad.', 8.2, b'0', b'1', b'1', b'1', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/KcgsDnt3CIw');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(20, 'Cero en conducta', 1999, 96, 'Adam Rifkin', 'Carl V. Dupré', 'J. Peter Robinson', 10, , 17, 'Cuando estás en el instituto nada puede fastidiar tus planes, especialmente si se trata del concierto de Kiss. Pero para llevar a cabo su sueño, Lex, Trip, Hawk y Jan tendrán que hacer de todo: robar un coche, huir del colegio, rescatar a uno de ellos del internado y enfrentarse a madres histéricas y paranoicas.', 7.3, b'0', b'1', b'0', b'0', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/Vio1n5neEok');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(21, 'Verónica', 2017, 105, 'Paco Plaza', 'Paco Plaza', 'Chucky Namanera', 7, , 10, 'Inspirada en una historia real sucedida en el madrileño barrio de Vallecas en los años 90. Tras hacer una ouija con unas amigas, una adolescente es asediada por aterradoras presencias sobrenaturales que amenazan con hacer daño a toda su familia.', 7.1, b'1', b'1', b'0', b'1', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/wNlMIvKnjOQ');
