(22, 'Escape Room', 2019, 99, 'Adam Robitel', 'Maria Melnik', 'John Carey', 6, , 10, 'Seis personas quedan atrapadas en un escape room cuyo creador ha diseñado una trampa mortal en cada habitación. No saben por qué les está haciendo esto, pero sí saben que un solo error les costará la vida.', 7.6, b'0', b'0', b'1', b'1', b'0', b'1', b'0', 'https://www.youtube-nocookie.com/embed/9C1V8XPBlkw');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(23, 'Tick Tick Boom', 2021, 115, 'Lin-Manuel Miranda', 'Steven Levenson', 'Jonathan Larson', 8, , 12, 'Basada en el musical autobiográfico de Jonathan Larson, sigue a un aspirante a compositor de obras teatrales que trabaja de camarero en Nueva York mientras escribe Superbia, que espera que sea el próximo gran musical americano y lo que finalmente le dé su gran oportunidad. Jon también se ve presionado por su novia, Susan, cansada de poner las aspiraciones profesionales de Jon por delante de su propia vida.', 7.6, b'1', b'0', b'0', b'0', b'0', b'0', b'0', 'https://www.youtube-nocookie.com/embed/DlEOr3hsGhs');
INSERT INTO `pelicula` (`id`, `titulo`, `anio`, `duracion`, `director`, `guion`, `bandasonora`, `id_genero`, `poster`, `id_productora`, `sinopsis`, `nota`, `netflix`, `amazonprime`, `appletv`, `googleplay`, `disneyplus`, `hbomax`, `skyshowtime`, `trailer`) VALUES
(24, 'Kingsman', 2014, 129, 'Matthew Vaughn', 'Matthew Vaughn', 'Henry Jackman', 2, , 3, 'Un veterano agente secreto inglés (Colin Firth) debe entrenar a un joven sin refinar (Taron Egerton), pero que promete convertirse en un competitivo agente gracias a un ultra-programa de entrenamiento, al mismo tiempo que una amenaza global emerge procedente de un genio retorcido. Adaptación del cómic de Mark Millar y Dave Gibbons.', 7.5, b'0', b'0', b'1', b'1', b'1', b'0', b'0', 'https://www.youtube-nocookie.com/embed/Rs5J8kh62yo');
